import React, {Component} from 'react'

class Dashboard extends Component {
    constructor(props) {
        super(props);
        this.state = {
            meetList: ''
        }
    }

    getMeet = () => {
        let token = localStorage.getItem('token');
        fetch('http://localhost:8000/api/getMeet', {
            method: 'POST',
            headers: {
                'Content-Type': "application/json",
                Authorization: `JWT ${localStorage.getItem('token')}`
            },
            body: JSON.stringify({email: this.props.userState.email})
        })
            .then(res => res.json())
            .then(json => {
                console.log("getMeet", json);
                let dashboardContent = "";
                json.forEach(element => {
                    dashboardContent += JSON.stringify(element);
                });
                console.log(dashboardContent);
                this.setState({meetList: dashboardContent});
                return(dashboardContent);
            });

    }

    componentDidMount(){
        this.getMeet();
        setInterval(() => {
            console.log("Interval", this.state.meetList)
        }, 1000);
    }

    render() {
        ;
        const logged_in_dashboard = (
            <div>
                Welcome {this.props.userState.email}<br/>
                {this.state.meetList}
            </div>)

        const logged_out_dashboard = (
            <div>
                Login To View Dashboard
            </div>)

        return (
            
            <div>
                <br /><br /><br /><br />
                {
                    this.props.userState.logged_in ? logged_in_dashboard : logged_out_dashboard
                }

            </div>
        )
    }
}

export default Dashboard;
